import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';
import { Player, Controls } from '@lottiefiles/react-lottie-player';
import { Search, Music, PlusCircle, Play, Pause, SkipForward, SkipBack, Repeat } from 'lucide-react';

export default function App() {
  const [searchQuery, setSearchQuery] = useState('');
  const [searchResults, setSearchResults] = useState([]);
  const [playlists, setPlaylists] = useState({});
  const [currentPlaylist, setCurrentPlaylist] = useState('');
  const [currentTrack, setCurrentTrack] = useState(null);
  const [isPlaying, setIsPlaying] = useState(false);
  const [newPlaylistName, setNewPlaylistName] = useState('');
  const [loop, setLoop] = useState('none');
  
  const audioRef = useRef(null);

  useEffect(() => {
    fetchPlaylists();
  }, []);

  const fetchPlaylists = async () => {
    const response = await axios.get(`${process.env.REACT_APP_API_URL}/get_playlists`);
    setPlaylists(response.data);
  };

  const handleSearch = async () => {
    const response = await axios.get(`${process.env.REACT_APP_API_URL}/search?q=${searchQuery}`);
    setSearchResults(response.data);
  };

  const createPlaylist = async () => {
    if (newPlaylistName.trim() === '') return;
    await axios.post(`${process.env.REACT_APP_API_URL}/create_playlist`, { playlist_name: newPlaylistName });
    setNewPlaylistName('');
    fetchPlaylists();
  };

  const addToPlaylist = async (videoId, videoTitle) => {
    if (!currentPlaylist) return;
    await axios.post(`${process.env.REACT_APP_API_URL}/add_to_playlist`, {
      video_id: videoId,
      video_title: videoTitle,
      playlist_name: currentPlaylist
    });
    fetchPlaylists();
  };

  const playTrack = async (videoId) => {
    const response = await axios.get(`${process.env.REACT_APP_API_URL}/get_audio_url?video_id=${videoId}`);
    setCurrentTrack({ id: videoId, url: response.data.audio_url });
    setIsPlaying(true);
    audioRef.current.src = response.data.audio_url;
    audioRef.current.play();
  };

  const togglePlayPause = () => {
    if (isPlaying) {
      audioRef.current.pause();
    } else {
      audioRef.current.play();
    }
    setIsPlaying(!isPlaying);
  };

  const handleLoop = () => {
    if (loop === 'none') setLoop('one');
    else if (loop === 'one') setLoop('all');
    else setLoop('none');
  };

  return (
    <div className="flex flex-col h-screen bg-gray-100">
      <header className="bg-blue-600 text-white p-4">
        <h1 className="text-2xl font-bold">YouTube Audio Player</h1>
      </header>
      <main className="flex-grow flex">
        <div className="w-1/3 p-4 bg-white shadow-md">
          <div className="mb-4">
            <input 
              type="text" 
              value={searchQuery} 
              onChange={(e) => setSearchQuery(e.target.value)} 
              placeholder="Search for a song"
              className="w-full p-2 border rounded"
            />
            <button onClick={handleSearch} className="mt-2 bg-blue-500 text-white p-2 rounded w-full flex items-center justify-center">
              <Search size={18} className="mr-2" /> Search
            </button>
          </div>
          <div className="mb-4">
            <h2 className="text-xl font-semibold mb-2">Search Results</h2>
            <ul>
              {searchResults.map((result) => (
                <li key={result.id} className="mb-2 p-2 bg-gray-100 rounded flex justify-between items-center">
                  <span>{result.title}</span>
                  <div>
                    <button onClick={() => addToPlaylist(result.id, result.title)} className="mr-2 text-blue-500">
                      <PlusCircle size={18} />
                    </button>
                    <button onClick={() => playTrack(result.id)} className="text-green-500">
                      <Play size={18} />
                    </button>
                  </div>
                </li>
              ))}
            </ul>
          </div>
        </div>
        <div className="w-1/3 p-4 bg-gray-50 shadow-md">
          <h2 className="text-xl font-semibold mb-2">Playlists</h2>
          <div className="mb-4">
            <input 
              type="text" 
              value={newPlaylistName} 
              onChange={(e) => setNewPlaylistName(e.target.value)} 
              placeholder="New playlist name"
              className="w-full p-2 border rounded"
            />
            <button onClick={createPlaylist} className="mt-2 bg-green-500 text-white p-2 rounded w-full flex items-center justify-center">
              <PlusCircle size={18} className="mr-2" /> Create Playlist
            </button>
          </div>
          <select 
            onChange={(e) => setCurrentPlaylist(e.target.value)} 
            className="w-full p-2 border rounded mb-4"
          >
            <option value="">Select a playlist</option>
            {Object.keys(playlists).map((playlist) => (
              <option key={playlist} value={playlist}>{playlist}</option>
            ))}
          </select>
          {currentPlaylist && (
            <ul>
              {playlists[currentPlaylist].tracks.map((track) => (
                <li key={track.id} className="mb-2 p-2 bg-gray-100 rounded flex justify-between items-center">
                  <span>{track.title}</span>
                  <button onClick={() => playTrack(track.id)} className="text-green-500">
                    <Play size={18} />
                  </button>
                </li>
              ))}
            </ul>
          )}
        </div>
      </main>
      <footer className="bg-gray-800 text-white p-4">
        <div className="flex justify-between items-center">
          <div className="flex items-center">
            {currentTrack && (
              <>
                <Player
                  autoplay
                  loop
                  src="https://assets9.lottiefiles.com/packages/lf20_jjtkxcfk.json"
                  style={{ height: '50px', width: '50px' }}
                >
                  <Controls visible={false} />
                </Player>
                <span className="ml-2">{playlists[currentPlaylist]?.tracks.find(t => t.id === currentTrack.id)?.title || 'Unknown Track'}</span>
              </>
            )}
          </div>
          <div className="flex items-center">
            <button onClick={() => {}} className="mr-4 text-white">
              <SkipBack size={24} />
            </button>
            <button onClick={togglePlayPause} className="mr-4 text-white">
              {isPlaying ? <Pause size={24} /> : <Play size={24} />}
            </button>
            <button onClick={() => {}} className="mr-4 text-white">
              <SkipForward size={24} />
            </button>
            <button onClick={handleLoop} className="text-white">
              <Repeat size={24} color={loop !== 'none' ? '#4CAF50' : 'white'} />
            </button>
          </div>
        </div>
      </footer>
      <audio ref={audioRef} onEnded={() => setIsPlaying(false)} loop={loop === 'one'} />
    </div>
  );
}
